import React, {Component} from "react";
import './Navbar.css'
import { useNavigate } from "react-router-dom";

function Navbar(){

    const navigate = useNavigate();

    // function handleClick() {
    //     navigate("/About")
    // }

        return (
            <div className="main">
            <nav className="nav">
                <h3 className="heading">MyPortfolio</h3>
                <ul> 
                    <li>
                         <a className="about-btn" onClick={()=>navigate("/About")}><b>About Me </b></a>
                    </li>
                    <li>
                        <a><b>Services</b></a>
                        </li>
                    <li>
                        <a><b>Portfolio</b></a>
                    </li>

                    <li>
                        <a><b>Skillset</b></a>
                    </li>

                    <li>
                        <a><b>Contact Me</b></a>
                    </li>
                </ul>
                <h4 className="resume-btn">MyResume</h4>
            </nav>
            </div>
        );
    }
export default Navbar;
